import React,{Component} from 'react';
import {Button,Image} from 'react-bootstrap';
import './CustomNav.css';
export default class Home extends Component{
render(){
    var background = {backgroundSize : 'cover'};
    var textStyle = {
      position: 'absolute', 
      top: '50%', 
      left: '50%'
    };
    return(
            <div style={{width: 'auto'}}>
                 <Image 
                  style={background} responsive 
                  src="foto">
                </Image>
                <main role="main" className="inner cover">
                <h1 className="cover-heading">Welcome To MSM School Management</h1>
                <p className="lead text">
                Cover is a one-page template for building simple and beautiful home pages.<br></br>
                Download, edit the text, and add your own fullscreen background photo to make it your own.</p>
                <p className="lead">
                <Button  variant="light" class="btn btn-lg">Learn more</Button>
                </p>
                </main>
            </div>
    )
}
}
